import "../../../index.css";
export default function DoRegistration() {
    return (
        <div style={{ display: "flex",
        marginLeft: "312px", }}>
      <table>
            <thead scope="col">번호</thead>
            <thead scope="col">제목</thead>
            <thead scope="col" colspan="2">이름</thead>
           <tbody rowspan="3">1</tbody>
           
        <tr>
            <td>테이블-3</td>
            <td>도우너</td>
            <td>30</td>
        </tr>
</table>
</div>
      
    );
}
